import React from 'react';
import TaskItem from './TaskItem';

function TaskList({ tasks }) {
  return (
    <div className="my-6">
      <h2 className="text-2xl mb-4">Task List</h2>
      <div className="space-y-4">
        {tasks.map((task) => (
          <TaskItem key={task.id} task={task} />
        ))}
      </div>
    </div>
  );
}

export default TaskList;
